output:
Since the projection of $\begin{pmatrix} -6 \\ 3 \end{pmatrix}$ is $\begin{pmatrix} -\frac{36}{13} \\ \frac{18}{13} \end{pmatrix},$ the vector being projected onto is a scalar multiple of $\begin{pmatrix} -\frac{36}{13} \\ \frac{18}{13} \end{pmatrix}.$ Thus, we can assume that the vector being projected onto is $\begin{pmatrix} -2 \\ 1 \end{pmatrix}.$

[asy]
usepackage("amsmath");

unitsize(1 cm);

draw((-2,0)--(4,0));
draw((0,-5)--(0,3));
draw((0,0)--(-6,3),Arrow(6));
draw((0,0)--(-36/13,18/13),Arrow(6));
draw((-6,3)--(-36/13,18/13),dashed,Arrow(6));
draw((0,0)--(1,-4),Arrow(6));
draw((0,0)--(6/13,-24/13),Arrow(6));
draw((1,-4)--(6/13,-24/13),dashed,Arrow(6));

label("$\begin{pmatrix} -6 \\ 3 \end{pmatrix}$", (-6,3), NW);
label("$\begin{pmatrix} -\frac{36}{13} \\ \frac{18}{13} \end{pmatrix}$", (-36/13,18/13), W);
label("$\begin{pmatrix} 1 \\ -4 \end{pmatrix}$", (1,-4), SE);
[/asy]

Thus, the projection of $\begin{pmatrix} 1 \\ -4 \end{pmatrix}$ is
\[\operatorname{proj}_{\begin{pmatrix} -2 \\ 1 \end{pmatrix}} \begin{pmatrix} 1 \\ -4 \end{pmatrix} = \frac{\begin{pmatrix} 1 \\ -4 \end{pmatrix} \cdot \begin{pmatrix} -2 \\ 1 \end{pmatrix}}{\begin{pmatrix} -2 \\ 1 \end{pmatrix} \cdot \begin{pmatrix} -2 \\ 1 \end{pmatrix}} \begin{pmatrix} -2 \\ 1 \end{pmatrix} = \frac{-6}{5} \begin{pmatrix} -2 \\ 1 \end{pmatrix} = \boxed{\begin{pmatrix}\frac{12}{5}\-\frac{6}{5}\end{pmatrix}}.\] The answer is: \begin{pmatrix}\frac{12}{5}\-\frac{6}{5}\end{pmatrix}

