We start by fully expanding and simplifying the given expression:

\begin{align*}
4(x^2-2x+2)-7(x^3-3x+1) &= 4x^2 - 8x + 8 - 7x^3 + 21x - 7 \\
                         &= -7x^3 + (4x^2) + (-8x + 21x) + (8 - 7) \\
                         &= -7x^3 + 4x^2 + 13x + 1.
\end{align*}

The coefficients of the simplified expression are $-7$, $4$, $13$, and $1$. We need to find the sum of the squares of these coefficients:

\begin{align*}
(-7)^2 + 4^2 + 13^2 + 1^2 &= 49 + 16 + 169 + 1 \\
                           &= 49 + 16 + 169 + 1 \\
                           &= 235.
\end{align*}

Thus, the sum of the squares of the coefficients of the terms is $\boxed{235}$. The answer is: 235

