\begin{align*} T + \left( \frac{a}{d} + \frac{d}{a} \right)^2 + \left( \frac{b}{e} + \frac{e}{b} \right)^2 &= 75 + \left( 14 - 9 \right)^2 \\[5pt] &= 75 + 5^2 \\[5pt] &= 75 + 25 \\[5pt] &= 100. \end{align*}
Therefore, the minimum value is $\boxed{100}$. The answer is: 100

