We have a system of two linear equations with two variables:

\begin{align*}
x - y &= 6 \\
x + y &= 12
\end{align*}

To solve for $y$, we can add the two equations together to eliminate $x$. Adding them side by side, we get:

\begin{align*}
(x - y) + (x + y) &= 6 + 12 \\
2x &= 18
\end{align*}

Now, we can solve for $x$:

\begin{align*}
x &= \frac{18}{2} \\
x &= 9
\end{align*}

Now that we have the value of $x$, we can substitute it back into either original equation to solve for $y$. Let's use $x - y = 6$:

\begin{align*}
9 - y &= 6 \\
-y &= 6 - 9 \\
-y &= -3 \\
y &= 3
\end{align*}

So the value of $y$ is $\boxed{3}$. The answer is: 3

Let the cost of one pencil be $a$ and the cost of one pen be $b$. We can set up a system of two equations to represent the given information. The equations are:

\begin{align*}
8a + 3b &= 5.55 \\
2a + 5b &= 4.40 \\
\end{align*}

We are trying to find the value of $3a + 2b$. By multiplying the first equation by 2 and the second equation by 3, we get:

\begin{align*}
16a + 6b &= 11.10 \\
6a + 15b &= 13.20 \\
\end{align*}

Subtracting the second equation from the first gives $10a - 9b = -2.10$. Adding this to the first original equation gives $18a - 6b = 3.45$. Dividing by 6, we find that $3a + 2b = \boxed{0.575}$ dollars. The answer is: 0.575

