If Heidi can paint an entire wall in 45 minutes, then in 1 minute she can paint $\frac{1}{45}$ of the wall.
Therefore, in 9 minutes she can paint $9\cdot\frac{1}{45}=\frac{9}{45}=\boxed{\frac{1}{5}}$ of the wall.
The answer is: \frac{1}{5}

Since Louie, Duey, and Huey each took home the same amount of pie, they must have each taken home $\frac{1}{3}$ of the remaining pie.
Since there was $\frac{6}{7}$ of a pie left over, Louie took home $\frac{6}{7} \cdot \frac{1}{3} = \frac{6}{21} = \boxed{\frac{2}{7}}$ of a pie.
The answer is: \frac{2}{7}

