Please solve the following problem and put your answer at the end with "The answer is: ".

The cube below has sides of length 4 feet. If a cylindrical section of radius X feet is removed from the solid, what is the total remaining volume of the cube? Express your answer in cubic feet in terms of $\pi$.

[asy]
import solids; size(150); import three; defaultpen(linewidth(0.8)); currentprojection = orthographic(4,2.5,3);

draw((1,-1,0)--(1,1,0)--(-1,1,0)); draw((-1,1,0)--(-1,-1,0)--(1,-1,0), dashed);
draw((1,-1,2)--(1,1,2)--(-1,1,2)--(-1,-1,2)--cycle);
draw((1,-1,0)--(1,-1,2)); draw((1,1,0)--(1,1,2)); draw((-1,-1,0)--(-1,-1,2),dashed); draw((-1,1,0)--(-1,1,2));revolution c = cylinder((0,0,0), 1, 2);
draw(c,black);
[/asy]
If we know the answer to the above question is 64-16\pi, what is the value of unknown variable X?

